import React from 'react';
import './index.css';
type HeaderProps = {
  heading?: string
}

function Header({heading}:HeaderProps) {
  return (
    <div className="headerContainer">
      <p className="headerTitleStyle">{heading || 'Todo App'}</p>
    </div>
  );
}

export default Header;
